import React from 'react';
import {Navbar} from '../../common';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faFacebook,
    faTwitter,
    faInstagram,
} from '@fortawesome/free-brands-svg-icons';

import './Header.css';
function Header (){
    return(
        <div>
        <section className="header-name">
            <h1 className="header-name-title">InstaFill</h1>
            <h1 className="header-name-item">Form Magic!</h1>
            
            <section className="header-socials">
            <FontAwesomeIcon className="header-socials-item" icon={faTwitter} size='2x' />
            <FontAwesomeIcon className="header-socials-item" icon={faInstagram} />
            <FontAwesomeIcon className="header-socials-item" icon={faFacebook} />
            </section>
        </section>
        </div>
    )
}
export default Header;
